    return (
      <div class="bg-gray-900 rounded-lg float w-5">
      <div class="px-4 ">
      <ul className="text-white ITEMS-center">
      <li><h1>TITLE1</h1>      </li>
      <li><h1>TITLE2</h1>      </li>
      <li><h1>TITLE3</h1>      </li>
      <li><h1>TITLE4</h1>      </li>

      </ul>
        
      </div>
    </div>
    );
  };
  export default FloatingNavBar;
